import React, { useState } from "react";

const SearchPage: React.FC = () => {
  const [query, setQuery] = useState("");
  const [results, setResults] = useState<string[]>([]);

  const handleSearch = (e: React.FormEvent) => {
    e.preventDefault();
    // API 대신 임시 데이터
    setResults([
      "로봇이 블록을 파지하는 장면",
      "작업자가 로봇 동작을 모니터링",
      "로봇이 대상을 옮기는 모습",
      "안전 구역에서 대기하는 작업자",
      "대상을 컵에 넣는 장면",
      "로봇이 자세를 조정하는 동작"
    ]);
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-br from-indigo-100 via-white to-indigo-50 py-12 px-4">
      {/* 검색 박스 */}
      <div className="w-full max-w-xl p-8 bg-white rounded-2xl shadow-lg mb-12 text-center">
        <h1 className="text-3xl font-bold text-indigo-600 mb-6">
          🔍 영상 검색
        </h1>
        <form onSubmit={handleSearch} className="flex gap-3">
          <input
            type="text"
            placeholder="검색어를 입력하세요..."
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            className="flex-1 p-3 rounded-xl border border-gray-300 focus:outline-none focus:ring-2 focus:ring-indigo-400"
          />
          <button
            type="submit"
            className="px-6 py-3 bg-indigo-500 text-white rounded-xl shadow hover:bg-indigo-600 transition"
          >
            검색
          </button>
        </form>
      </div>

      {/* 검색 결과 */}
      {results.length > 0 && (
        <div className="w-full max-w-5xl grid grid-cols-1 sm:grid-cols-2 gap-8">
          {results.map((item, idx) => (
            <div
              key={idx}
              className="flex flex-col items-center p-6 bg-white rounded-2xl shadow hover:shadow-xl transition"
            >
              <div className="w-24 h-24 bg-indigo-100 rounded-full flex items-center justify-center mb-4">
                <span className="text-2xl">🎬</span>
              </div>
              <h2 className="text-lg font-semibold text-gray-700 text-center">
                {item}
              </h2>
              <p className="text-sm text-gray-500 mt-2">
                검색 결과 #{idx + 1}
              </p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default SearchPage;
